import React from 'react';
import {Link} from 'react-router-dom'

export default function Navigation() {
  return (
    <ul className="Navigation">
      <li>
        <Link to="/create">Create A Post</Link>
      </li>
      <li>
        <Link to="/show">Show Current Posts</Link>
      </li>
    </ul>
  )
}
